import React from 'react';
import '../Data/products.json';

const ProductList = ({ item }) => (
    <div className="productRow">
        <div className={item.priceCategory, item.type}>
            <img className="productImage" src={item.photo} alt={item.alt} />
            <h3 className="headingCenter">{item.name}</h3>
            <p className="productDescription">{item.price}</p>
            <p>{item.description}</p>
            <button className="btn1">Add To Cart</button>
        </div>
    </div>
);

export default ProductList;
